import React from "react";

import DataCollaborator from "./1-data-collaborator";
import WarningProfiler from "./2-warning-profiler";
import ResultProfiler from "./3-result-profiler";
import NegativePositive from "./4-negative-positive";
import AboutYou from "./5-about-you";
import SituationalIndicators from "./6-situational-indicators";
import TaskPerformance from "./7-task-performance";
import ClearanceFactors from "./8-clearance-factors";
import MotivatingFactors from "./9-motivating-factors";
import MiddleRequirements from "./10-middle-requirements";
import SearchResults from "./11-search-results";
import BasicSkills from "./12-basic-skills";
import Competences from "./13-competences";
import CommonSkills from "./14-common-skills";
import Skills from "./15-skills";
import "./index.scss";

const Content = ({ profiler, infoUser, canShowAll }) => {
    console.log(profiler, infoUser, canShowAll);
    if (Object.keys(profiler).length > 0 && Object.keys(infoUser).length > 0) {
        if (canShowAll === true) {
            return (
                <div className="content-result-noAuth">
                    <div className="container-profiler">
                        <DataCollaborator infoUser={infoUser} />
                        <WarningProfiler text={profiler.test_validation} />
                        <ResultProfiler
                            infoUser={infoUser}
                            data={profiler.chart_data.predominant_profiler}
                        />
                        <NegativePositive
                            data={profiler.chart_data.detailed_profilers}
                        />
                        <AboutYou texts={profiler.profile_texts} />
                        <SituationalIndicators
                            data={profiler.chart_data.situational_indicators}
                        />
                        <TaskPerformance texts={profiler.profile_texts} />
                        <ClearanceFactors texts={profiler.profile_texts} />
                        <MotivatingFactors texts={profiler.profile_texts} />
                        <MiddleRequirements
                            data={profiler.chart_data.environment_requeriment}
                            texts={profiler.profile_texts}
                        />
                        <SearchResults
                            data={profiler.chart_data.reach_results}
                            texts={profiler.profile_texts}
                        />
                        <BasicSkills texts={profiler.profile_texts} />
                        <Competences data={profiler.chart_data.talent_area} />
                        <CommonSkills texts={profiler.profile_texts} />
                        <Skills data={profiler.chart_data.skills} />
                    </div>
                </div>
            );
        } else {
            return (
                <div className="content-result-noAuth">
                    <div className="container-profiler">
                        <DataCollaborator infoUser={infoUser} />
                        <WarningProfiler
                            text={profiler.test_validation}
                            canShowAll={canShowAll}
                        />
                        <ResultProfiler
                            infoUser={infoUser}
                            data={profiler.chart_data.predominant_profiler}
                            canShowAll={canShowAll}
                        />
                        <AboutYou
                            texts={profiler.profile_texts}
                            canShowAll={canShowAll}
                        />
                    </div>
                </div>
            );
        }
    } else {
        return <div>teste</div>;
    }
};

export default Content;
